import{_ as e,o as t,c as a,a as r}from"./app.03e99220.js";const s='{"title":"Shadowrocket","description":"","frontmatter":{},"headers":[{"level":2,"title":"快速开始","slug":"快速开始"},{"level":2,"title":"添加一个「订阅」","slug":"添加一个「订阅」"},{"level":2,"title":"如何引导至订阅界面 返回","slug":"如何引导至订阅界面-返回"},{"level":2,"title":"如何让节点按照延迟的由低到高的顺序排列？ 返回","slug":"如何让节点按照延迟的由低到高的顺序排列？-返回"}],"relativePath":"tutorial/ios-shadowrocket.md"}',c={},i=[r('<h1 id="shadowrocket" tabindex="-1">Shadowrocket <a class="header-anchor" href="#shadowrocket" aria-hidden="true">#</a></h1><div class="warning custom-block"><p class="custom-block-title">注意</p><p>iOS部分的教程图片只适配手机尺寸，用电脑等大屏幕去看会引起不适 部分图片细节处有差异</p></div><div class="tip custom-block"><p class="custom-block-title">提示</p><p><strong>请更新至最新版Shadowrocket</strong></p></div><h2 id="快速开始" tabindex="-1">快速开始 <a class="header-anchor" href="#快速开始" aria-hidden="true">#</a></h2><p>1.关闭代理(VPN)</p><p>2.<a href="https://suo.yt/ApA4A0J" target="_blank" rel="noopener noreferrer">👉点击这里👈</a></p><p>3.会出现一个窗口并询问 <br><strong>在”Shadowrocket”中打开此页？</strong><br>点击“打开”会跳转到Shadowrocket</p><p>4.进入Shadowrocket，会自动“下载”并显示“完成”</p><p>5.<a href="#how-to-copy">请继续第6到第12步以进行VPN的初始化</a></p><h2 id="添加一个「订阅」" tabindex="-1">添加一个「订阅」 <a class="header-anchor" href="#添加一个「订阅」" aria-hidden="true">#</a></h2><ol><li><p>复制下面的链接，此链接叫「订阅」 <code>http://openit.ml/https</code></p></li><li><p>点击红框处 <img src="https://user-images.githubusercontent.com/78414278/162119131-0af29d68-fddb-4f5a-b097-b0f7dcc44d7e.jpeg" alt=""></p></li><li><p>如果刚才复制了「订阅」，此时会出现如图所示的画面 <img src="https://user-images.githubusercontent.com/78414278/162119214-a2b834cb-d06c-43af-a618-6516a94a41e3.jpeg" alt=""></p></li></ol><h5 id="如果没有出现上述界面点击此处了解如何引导至订阅界面" tabindex="-1">如果没有出现上述界面点击此处了解<a href="#%E5%A6%82%E4%BD%95%E5%BC%95%E5%AF%BC%E8%87%B3%E8%AE%A2%E9%98%85%E7%95%8C%E9%9D%A2-%E8%BF%94%E5%9B%9E">如何引导至订阅界面</a> <a class="header-anchor" href="#如果没有出现上述界面点击此处了解如何引导至订阅界面" aria-hidden="true">#</a></h5><ol start="4"><li>点击红框处 <img src="https://user-images.githubusercontent.com/78414278/162119332-c75ce7a8-5862-4d1b-ac9b-e23bee9b83b9.jpeg" alt=""></li><li>双击，粘贴上文复制的「订阅」点击右上角的完成</li></ol><blockquote><p>上文的「订阅」<code>http://openit.ml/https</code></p></blockquote><p><img src="https://user-images.githubusercontent.com/78414278/162119462-21829b4c-bd0d-4d02-810a-91b774f77bec.jpeg" alt=""></p><h5 id="how-to-copy" tabindex="-1">how to copy? <a class="header-anchor" href="#how-to-copy" aria-hidden="true">#</a></h5><ol start="6"><li>会回到上一层界面并显示“更新中” <img src="https://user-images.githubusercontent.com/78414278/162119544-6e4a3393-df5d-4244-b1fe-97057d458f62.jpeg" alt=""> 接着“询问是否允许后台更新” <br>点击「启动」,「订阅」可以后台更新 <img src="https://user-images.githubusercontent.com/78414278/162119642-9afedab4-3e3b-4042-8a4f-f45b98cbe4f0.jpeg" alt=""> 保存成功 <img src="https://user-images.githubusercontent.com/78414278/162119720-788391c0-29ba-481c-a7bb-734096bb40ad.jpeg" alt=""> 或者在显示「更新中」后出现如下图等提示，请检查您的网络是否可以连接互联网 <br><strong>不需要开启VPN</strong><img src="https://user-images.githubusercontent.com/78414278/161928785-33d853a5-725b-4951-b703-df3a57322f25.jpeg" alt=""></li><li>如果一切正常，会出现下图所示的节点 <img src="https://user-images.githubusercontent.com/78414278/162119819-04c688c1-050b-4a8a-ad47-73f747b6bff8.jpeg" alt=""></li><li>向右滑动 <img src="https://user-images.githubusercontent.com/78414278/162119864-26f7c9ff-978e-4cdb-80bc-54aaab81d1a8.jpeg" alt=""></li><li>点击测试，会弹出一个窗口 <img src="https://user-images.githubusercontent.com/78414278/162119929-8c34819b-0c04-495f-ac1c-c4cc673da768.jpeg" alt=""></li><li>在弹出的窗口中依次点击「好」「允许」然后跳转到设置 <img src="https://user-images.githubusercontent.com/78414278/162119968-fe86c91e-9438-4ac4-ba81-76e4f3d2690f.jpeg" alt=""><img src="https://user-images.githubusercontent.com/78414278/162120017-f5fa8119-2295-4705-8ce2-073913510191.jpeg" alt=""></li><li>使用触控ID（iPhone 8及以下机型）面容ID（iPhone全面屏机型）验证通过以添加VPN <img src="https://user-images.githubusercontent.com/78414278/162120060-a76ac77b-c8f8-412e-a992-f39f00adaeaf.jpeg" alt=""></li><li>回到Shadowrocket，选择延迟较低的节点，此时发现手机顶栏出现VPN图标，出现此图标说明VPN已经连接成功</li></ol><h5 id="如何让节点按照延迟的由低到高的顺序排列" tabindex="-1"><a href="#%E5%A6%82%E4%BD%95%E8%AE%A9%E8%8A%82%E7%82%B9%E6%8C%89%E7%85%A7%E5%BB%B6%E8%BF%9F%E7%9A%84%E7%94%B1%E4%BD%8E%E5%88%B0%E9%AB%98%E7%9A%84%E9%A1%BA%E5%BA%8F%E6%8E%92%E5%88%97-%E8%BF%94%E5%9B%9E">如何让节点按照延迟的由低到高的顺序排列?</a> <a class="header-anchor" href="#如何让节点按照延迟的由低到高的顺序排列" aria-hidden="true">#</a></h5><p><br>试一试Google等网页是否可以访问 <a href="https://Google.com" target="_blank" rel="noopener noreferrer">https://Google.com</a></p><hr><h2 id="如何引导至订阅界面-返回" tabindex="-1">如何引导至订阅界面 <a href="#%E5%A6%82%E6%9E%9C%E6%B2%A1%E6%9C%89%E5%87%BA%E7%8E%B0%E4%B8%8A%E8%BF%B0%E7%95%8C%E9%9D%A2%E7%82%B9%E5%87%BB%E6%AD%A4%E5%A4%84%E4%BA%86%E8%A7%A3%E5%A6%82%E4%BD%95%E5%BC%95%E5%AF%BC%E8%87%B3%E8%AE%A2%E9%98%85%E7%95%8C%E9%9D%A2">返回</a> <a class="header-anchor" href="#如何引导至订阅界面-返回" aria-hidden="true">#</a></h2><ol><li>点击红框内任意一项 <img src="https://user-images.githubusercontent.com/78414278/162120113-60f8a5f4-6dc3-4da6-a323-c381a6417932.jpeg" alt=""></li><li>如果没有复制其他「订阅」会出现下图内容，点击「类型」 <img src="https://user-images.githubusercontent.com/78414278/162120151-c8eff5b7-8536-4909-bb4a-8e9de64b139a.jpeg" alt=""></li><li>出现如图，点击Subscribe，回到上层界面，可以进行后续步骤了 <img src="https://user-images.githubusercontent.com/78414278/162120283-9f83b774-f779-4385-bd1b-866cfa412241.jpeg" alt=""><img src="https://user-images.githubusercontent.com/78414278/162119214-a2b834cb-d06c-43af-a618-6516a94a41e3.jpeg" alt=""><a href="#%E5%A6%82%E6%9E%9C%E6%B2%A1%E6%9C%89%E5%87%BA%E7%8E%B0%E4%B8%8A%E8%BF%B0%E7%95%8C%E9%9D%A2%E7%82%B9%E5%87%BB%E6%AD%A4%E5%A4%84%E4%BA%86%E8%A7%A3%E5%A6%82%E4%BD%95%E5%BC%95%E5%AF%BC%E8%87%B3%E8%AE%A2%E9%98%85%E7%95%8C%E9%9D%A2">返回</a></li></ol><h2 id="如何让节点按照延迟的由低到高的顺序排列？-返回" tabindex="-1">如何让节点按照延迟的由低到高的顺序排列？ <a href="#%E5%A6%82%E4%BD%95%E8%AE%A9%E8%8A%82%E7%82%B9%E6%8C%89%E7%85%A7%E5%BB%B6%E8%BF%9F%E7%9A%84%E7%94%B1%E4%BD%8E%E5%88%B0%E9%AB%98%E7%9A%84%E9%A1%BA%E5%BA%8F%E6%8E%92%E5%88%97">返回</a> <a class="header-anchor" href="#如何让节点按照延迟的由低到高的顺序排列？-返回" aria-hidden="true">#</a></h2><ol><li>进入Shadowrocket，点击设置 <img src="https://user-images.githubusercontent.com/78414278/162120583-3235e85e-6cc9-4fe0-afbd-d356c7365d1e.jpeg" alt=""></li><li>进入设置，向上划动 <img src="https://user-images.githubusercontent.com/78414278/162120621-ac6c8930-8942-4619-b893-be913941b27a.jpeg" alt=""> 点击「订阅」 <img src="https://user-images.githubusercontent.com/78414278/162120683-3f8f4b6c-5c54-47a6-86af-ad1da48f8b1a.jpeg" alt=""></li><li>点击「根据Ping排序」旁边的按钮 <img src="https://user-images.githubusercontent.com/78414278/162120727-a89bab10-2de7-4b24-919b-4fd68126052f.jpeg" alt=""> 这将使节点根据延迟的高低排序 <a href="#%E5%A6%82%E4%BD%95%E8%AE%A9%E8%8A%82%E7%82%B9%E6%8C%89%E7%85%A7%E5%BB%B6%E8%BF%9F%E7%9A%84%E7%94%B1%E4%BD%8E%E5%88%B0%E9%AB%98%E7%9A%84%E9%A1%BA%E5%BA%8F%E6%8E%92%E5%88%97">返回</a></li></ol>',24)];var o=e(c,[["render",function(e,r,s,c,o,E){return t(),a("div",null,i)}]]);export{s as __pageData,o as default};
